INSERT INTO `style_translations` (`id`, `style_id`, `locale`, `name`, `description`, `note`) VALUES
(1, 1, 'fr', 'Acro', 'La routine contient une combinaison de danse et d’acrobaties, qui inclut des mouvements de contrôle, de gymnastique, de flexibilité et de contorsion. Ce style est caractérisé par l’équilibre, la force et/ou la flexibilité.', '*Minimum de 5 acrobaties'),
(2, 1, 'en', 'Acro', 'Combination of dance and acrobatic technique using controlled moves, gymnastic passes, flexibility or contortionist moves requiring balance, strength and/or flexibility.', '*Minimum 5 acrobatics'),
(3, 2, 'fr', 'Ballet/Pointe', 'La routine présente des techniques de ballet ou de pointe en incorporant des mouvements et pas classiques. Ce style est caractérisé par la grâce et la précision des mouvements.', '*Aucune acrobatie permise'),
(4, 2, 'en', 'Ballet/Pointe', 'Consist of ballet or pointe technique, while incorporating classical movements and steps, characterized by grace and precision of movement.', '*No acrobatic permitted'),
(5, 3, 'fr', 'Contemporain', 'La routine contient des mouvements et des techniques modernes en intégrant le contrôle, l’équilibre et les extensions. Ce style est caractérisé par des passages au sol, des contractions et des mouvements abstraits.', '*Maximum de 3 acrobaties'),
(6, 3, 'en', 'Contemporary', 'Contain modern dance technique and movement while incorporating balance, control and extensions. May involve floor works, use of contraction and release and abstract style.', '*Maximum 3 acrobatics'),
(7, 4, 'fr', 'Danse Urbaine', 'La routine doit être influencée par un ou plusieurs styles de la liste suivante : Breaking // Waacking // Locking // Popping/Boogaloo // House Dance // Voguing // Party Dances ou Club Dances // Krumping // Stepping // Gumboot // Dancehall // Hip Hop Choreo', '*Nombre d’acrobaties illimité'),
(8, 4, 'en', 'Urban Dance', 'The routine must be influenced by one or many of the following list: Breaking // Waacking // Locking // Popping/Boogaloo // House Dance // Voguing // 	Party Dances or Club Dances // Krumping // Stepping // Gumboot // Dancehall // Hip Hop Choreo', '*Unlimited number of acrobatics'),
(9, 5, 'fr', 'Jazz', 'La routine contient des techniques et mouvements de Jazz (extensions, battements, tours, etc.). Ce style est caractérisé par l’énergie, le rythme et la dynamique. ', '*Maximum de 3 acrobaties'),
(10, 5, 'en', 'Jazz', 'Contain standard jazz technique and performance (extensions, kicks, turns, etc.) Characterized by high energy, rhythm and dynamics.', '*Maximum 3 acrobatics'),
(11, 6, 'fr', 'Lyrique', 'La routine contient une combinaison des techniques de Jazz et de Ballet. Ce style est caractérisé par l’accent mis sur l’émotion et sur les éléments qui racontent une histoire, en portant une attention particulière aux paroles de la chanson.', '*Maximum de 3 acrobaties'),
(12, 6, 'en', 'Lyrical', 'Contain a combination of jazz and ballet techniques while incorporating emotional and storytelling elements with specific attention to music lyrics.', '*Maximum 3 acrobatics'),
(13, 7, 'fr', 'Open', 'La routine présente un style qui n’est pas mentionné dans les styles ci-haut ou qui représente une combinaison de plusieurs styles du Volet Technique.', '*Maximum de 3 acrobaties'),
(14, 7, 'en', 'Open', 'Any routine which does not fit into any of our styles or a routine which is a combination of two or more of our technical styles.', '*3 acrobatics maximum'),
(15, 8, 'fr', 'Tap', 'La routine contient des jeux de pieds dynamiques et percutants qui permettent d’accentuer des passages rythmiques précis. Les sons préenregistrés ne sont pas permis. Les souliers de Tap sont obligatoires.', '*Maximum de 3 acrobaties'),
(16, 8, 'en', 'Tap', 'Technique using percussive footwork that marks out precise rhythmic patterns. Pre-recorded Tap sounds will not be permitted. Tap shoes required.', '*Maximum 3 acrobatics'),
(17, 9, 'fr', 'Contemporain', 'La routine contient des mouvements et des techniques modernes en intégrant le contrôle, l’équilibre et les extensions. Ce style est caractérisé par des passages au sol, des contractions et des mouvements abstraits.', '*Maximum de 3 acrobaties'),
(18, 9, 'en', 'Contemporary', 'Contain modern dance technique and movement while incorporating balance, control and extensions. May involve floor works, use of contraction and release and abstract style.', '*Maximum 3 acrobatics'),
(19, 10, 'fr', 'Danse Urbaine', 'La routine doit être influencée par un ou plusieurs styles de la liste suivante : Breaking // Waacking // Locking // Popping/Boogaloo // House Dance // Voguing // Party Dances ou Club Dances // Krumping // Stepping // Gumboot // Dancehall // Hip Hop Choreo', '*Nombre d’acrobaties illimité'),
(20, 10, 'en', 'Urban Dance', 'The routine must be influenced by one or many of the following list: Breaking // Waacking // Locking // Popping/Boogaloo // House Dance // Voguing // 	Party Dances or Club Dances // Krumping // Stepping // Gumboot // Dancehall // Hip Hop Choreo', '*Unlimited number of acrobatics'),
(21, 11, 'fr', 'Jazz', 'La routine contient des techniques et mouvements de Jazz (extensions, battements, tours, etc.). Ce style est caractérisé par l’énergie, le rythme et la dynamique. ', '*Maximum de 3 acrobaties'),
(22, 11, 'en', 'Jazz', 'Contain standard jazz technique and performance (extensions, kicks, turns, etc.) Characterized by high energy, rhythm and dynamics.', '*Maximum 3 acrobatics'),
(23, 12, 'fr', 'Lyrique', 'La routine contient une combinaison des techniques de Jazz et de Ballet. Ce style est caractérisé par l’accent mis sur l’émotion et sur les éléments qui racontent une histoire, en portant une attention particulière aux paroles de la chanson.', '*Maximum de 3 acrobaties'),
(24, 12, 'en', 'Lyrical', 'Contain a combination of jazz and ballet techniques while incorporating emotional and storytelling elements with specific attention to music lyrics.', '*Maximum 3 acrobatics'),
(25, 13, 'fr', 'Open', 'La routine présente un style qui n’est pas mentionné dans les styles ci-haut ou qui représente une combinaison de plusieurs styles du Volet Technique.', '*Nombre d’acrobaties illimité'),
(26, 13, 'en', 'Open', 'Any routine which does not fit into any of our styles or a routine which is a combination of two or more of our technical styles.', '*Unlimited number of acrobatics'),
(27, 14, 'fr', 'Foundation ', 'La routine démontre une expertise précise et prédominante dans l’un ou plusieurs des styles suivants et elle intègre les mouvements précis de sa spécialisation :\r\nPopping // Waacking // Locking // Voguing // House // Krump // Breaking // Footwork // Litefeet // Memphis Jookin // Hustle // Dancehall // Afro // Stepping // Gumboot.', '*Nombre d’acrobaties illimité'),
(28, 14, 'en', 'Foundation', 'The routine demonstrates precise and predominant expertise in one or more of the following styles and incorporates the precise movements of its specialization: Popping // Waacking // Locking // Voguing // House // Krump // Breaking // Footwork // Litefeet // Memphis Jookin // Hustle // Dancehall // Afro // Stepping // Gumboot.\r\n\r\n\r\n\r\n\r\n', '*Unlimited number of acrobatics'),
(29, 15, 'fr', 'Choreo', 'La routine démontre une forte influence commerciale incluant des mouvements qui font allusion à du hip-hop chorégraphique. La routine est influencée par plusieurs styles de danse différents, mais est principalement basée sur la propre interprétation du chorégraphe en fonction de la musique.', '*Nombre d’acrobaties illimité'),
(30, 15, 'en', 'Choreo', 'The routine demonstrates a strong commercial influence including movements that allude to hip-hop grooves. The routine is influenced by several different dance styles but is mainly based on the choreographer\'s own interpretation of the music.', '*Unlimited number of acrobatics');
